import React from 'react';

interface Session {
    user?: {
        name: string;
        email?: string;
    };
}

export default function PublicWrapper({
    children,
    session
}: {
    children: React.ReactElement;
    session: Session;
}) {
    return React.cloneElement(children, { session });
}
